function code = GNSScodegen(svnum, modulation,ld)
%==========================================================================
%GNSScodegen Generates unsampled GNSS ranging code with values +/-1.
%
%   Inputs
%       svnum --> PRN. GPS: [1-32], GALILEO: [1-50]. BeiDou [1-37].
%                 Can be a vector.
%       modulation --> GPS: L1CA, L2CM, L2CL, L5I, L5Q.
%                      Galileo: E1B, E1C, E5aI, E5aQ, E5bI, E5bQ.
%                      BeiDou: B1I.
%       ld --> Set to "0" to compute the code, set to "1" to load from
%       memory (codes must be Matlab path).
%
%   Observations
%       # Chip lenght --> L1CA: 1023, L5I/L5Q/E5aI/EaQ/E5bI/E5bQ: 10230,
%       E1B/E1C: 4092, B1I: 2047, L2CM: 10230, L2CL: 767250.   
%       # This code have been tested satisfactorily to acquire real L1C/A, 
%       L2CM, L2CL, L2C, L5, E1OS, E5A, E5B and E5 signals, but there has 
%       not been any chance yet to test it with B1I.
%
%   References
%       # L1CA/L2: GPS Interface Control Document IS-GPS-200
%       # L5: GPS Interface Control Document IS-GPS-705
%       # Galileo: Galileo Open Service Signal In Space Interface Control
%       Document (OS SIS ICD)
%       # BeiDou: BeiDou Navigation Satellite System Signal In Space 
%       Interface Control Document 2.0
%--------------------------------------------------------------------------
% Version log (main changes)
%   02/03/2017 --> Log started
%   16/01/2019 --> svnum can now be a vector
%--------------------------------------------------------------------------
% Authors: Daniel Pascual (daniel.pascual [at] protonmail.com), 
% Raul Onrubia (onrubia [at] tsc.upc.es), Scott Gleason and D. Akos.
% Scott Gleason, and others
% License: GNU GPLv3
%==========================================================================

% Copyright 2000 D. Akos
% Copyright 2009 Scott Gleason
% Copyright 2014 Raul Onrubia
% Copyright 2017 Daniel Pascual 
% 
% This program is free software: you can redistribute it and/or modify
% it under the terms of the GNU General Public License as published by
% the Free Software Foundation, either version 3 of the License, or
% (at your option) any later version.
% 
% This program is distributed in the hope that it will be useful,
% but WITHOUT ANY WARRANTY; without even the implied warranty of
% MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the
% GNU General Public License for more details.
% 
% You should have received a copy of the GNU General Public License
% along with this program.  If not, see <http://www.gnu.org/licenses/>.

    if nargin == 2
        ld = 0;
    end

    switch(modulation)
        case 'L1CA'
            if ld == 0
                for i=1:length(svnum)
                    code(i,:) = codegen_L1CA(svnum(i));
                end
            elseif ld == 1
                codes = importdata('codes_L1CA.mat');
                code = codes(:,svnum).';
            end
        case 'L2CM'
            if ld == 0    
                for i=1:length(svnum)                
                    code(i,:) = codegen_L2CMCL(svnum(i),'CM');  
                end
            elseif ld == 1
                codes = importdata('codes_L2CM.mat');
                code = codes(:,svnum).';                
            end        
        case 'L2CL'
            if ld == 0     
                for i=1:length(svnum)                
                    code(i,:) = codegen_L2CMCL(svnum(i),'CL');
                end
            elseif ld == 1
                codes = importdata('codes_L2CL.mat');
                code = codes(:,svnum).';                    
            end     
        case {'L5I','L5Q'}
            if ld == 0  
                for i=1:length(svnum) 
                    code(i,:) = codegen_L5IQ(svnum(i),modulation);
                end
            elseif ld == 1
                codes = importdata(['codes_' modulation '.mat']);
                code = codes(:,svnum).'; 
            end  
        case {'E5aI','E5aQ','E5bI','E5bQ', 'E1B', 'E1C'}
            if ld == 0  
                for i=1:length(svnum)  
                    code(i,:) = codegen_E1E5(svnum(i),modulation);
                end
            elseif ld == 1
                codes = importdata(['codes_' modulation '.mat']);
                code = codes(:,svnum).';                 
            end    
        case 'B1I'
            if ld == 0
                for i=1:length(svnum)  
                    code(i,:) = codegen_B1I(svnum(i));
                end
            elseif ld == 1
                codes = importdata('codes_B1I.mat');
                code = codes(:,svnum).';
            end
    end
end

function code = codegen_L1CA(svnum)
%==========================================================================
% 
%--------------------------------------------------------------------------
% Obtained from Scott Gleason's book "GNSS Applications and Methods"
% (ISBN-13: 978-1596933293)
% Copyright 2000 D. Akos
% License: GNU GPL
%==========================================================================
    
    % the g2s vector holds the appropriate shift of the g2 code to generate
    % the C/A code (ex for SV#19 - use a G2 shift of g2s(19)=471)    
    g2s = [   5;   6;   7;   8;  17;  18; 139; 140; 141; 251; ...
        252; 254; 255; 256; 257; 258; 469; 470; 471; 472; ...
        473; 474; 509; 512; 513; 514; 515; 516; 859; 860; ...
        861; 862];

    g2shift = g2s(svnum,1);

    % ****** Generate G1 code ******
    % load shift register
    reg = -1*ones(1,10);
    g1 = zeros(1,1023);
    for i=1:1023
        g1(i) = reg(10);
        save1 = reg(3)*reg(10);
        reg(1, 2:10) = reg(1:1:9);
        reg(1) = save1;
    end

    % ****** Generate G2code ******
    % load shift register
    reg = -1*ones(1,10);
    for i=1:1023
        g2(i) = reg(10);
        save2 = reg(2)*reg(3)*reg(6)*reg(8)*reg(9)*reg(10);
        reg(1, 2:10) = reg(1:1:9);
        reg(1) = save2;
    end

    % ****** Shift G2 code ******
    g2tmp(1, 1:g2shift)      = g2(1, 1023-g2shift+1:1023);
    g2tmp(1, g2shift+1:1023) = g2(1, 1:1023-g2shift);
    g2 = g2tmp;

    % ****** Form single sample C/A code by multiplying G1 and G2 ******
    code = g1 .* g2;
end

